8.3. Definition of an Adverse Event
An AE is any untoward medical occurrence in a clinical investigation subject administered a product or medical device; the event need not necessarily have a causal relationship with the treatment or usage. Examples of AEs include but are not limited to:
• Abnormal test findings;
• Clinically significant symptoms and signs;
• Changes in physical examination findings;
• Hypersensitivity;
• Progression/worsening of underlying disease;
• Drug abuse;
• Drug dependency.
Additionally, they may include the signs or symptoms resulting from:
• Drug overdose;
• Drug withdrawal;
• Drug misuse;
• Drug interactions;
• Extravasation;
• Exposure during pregnancy (EPD);
• Exposure via breastfeeding;
• Medication error;
• Occupational exposure.
