• Admission for treatment of a preexisting condition not associated with the development of a new AE or with a worsening of the preexisting condition (eg, for work-up of persistent pre-treatment laboratory abnormality);
• Social admission (eg, subject has no place to sleep);
• Administrative admission (eg, for yearly physical examination);
• Protocol-specified admission during a study (eg, for a procedure required by the study protocol);
• Optional admission not associated with a precipitating clinical AE (eg, for elective cosmetic surgery);
• Hospitalization for observation without a medical AE;
• Pre-planned treatments or surgical procedures. These should be noted in the baseline documentation for the entire protocol and/or for the individual subject.
Diagnostic and therapeutic non-invasive and invasive procedures, such as surgery, should not be reported as AEs. However, the medical condition for which the procedure was performed should be reported if it meets the definition of an AE. For example, an acute appendicitis that begins during the AE reporting period should be reported as the AE, and the resulting appendectomy should be recorded as treatment of the AE.
