9.6.1.2. Events consistent with Hy’s Law
If two events are reported which are consistent with Hy’s Law in tanezumab-treated subjects, irrespective of dose across all ongoing osteoarthritis and chronic low back pain studies, dosing will be temporarily suspended in all studies until the relationship to investigational product is established for the given events which were consistent with Hy’s Law. If two events consistent with Hy’s Law are considered to be related to treatment with tanezumab or the cause cannot be determined, all dosing in the tanezumab osteoarthritis and chronic low back pain program may be stopped. The E-DMC will determine whether the dosing suspension should be triggered. Subsequently the E-DMC will formulate a recommendation whether all studies should be permanently terminated. Decisions regarding permanently stopping treatment and terminating studies will be made by the Sponsor in consultation with the DMC.
9.6.2. Joint Safety Events
If the blinded Adjudication Committee identifies adjudicated events of rapidly progressive osteoarthritis type 2, subchondral insufficiency fractures (or spontaneous osteonecrosis of the knee [SPONK]), primary osteonecrosis, or pathological fracture occurring at a combined rate that could trigger the protocol-based stopping criteria, an urgent, ad hoc assessment of the events will be made by the External Data Monitoring Committee.
The protocol (or treatment group) stopping rule has three components; the difference in the number of subjects with an adjudicated joint safety event, the exposure-adjusted risk difference (RD) and the exposure adjusted risk ratio (RR) between each tanezumab treatment group and the active comparator group. The exposure-adjusted RD will be calculated as the difference in the ratios of the number of subjects with an adjudicated joint safety event divided by exposure (subject-years) between each tanezumab group and the comparator group. The exposure-adjusted RR will be similarly calculated using the ratio of exposure adjusted event rates (number of subjects with an adjudicated joint safety event divided by exposure) for each tanezumab group relative to the comparator group. The exposure will be calculated as the combined treatment and follow-up periods.
